import React from "react";
import { Button, Input } from ".";
import '../scss/app.scss'

function SingupForm(props, {Singup}) {

  const submitHendler = e => {
    e.preventDefault();

    Singup(user)
  }

  const renderInput = () => {
    return Object.keys(props.user).map((dataIput, index) => {
      const data = props.user[dataIput]

      return (
        <Input
          type={data.type}
          value={data.value}
          label={data.label}
        />
      )
    })
  }

  return (
    <div className='authorization'>
          <div className="form">
              <h2>Sing Up</h2>
        <form onSubmit={submitHendler}>
          {renderInput()}
        </form>
      </div>
      <div className="block-of-buttons">
          <Button
            value="Sing Up"
            className="singUp"
            // disabled={!state.isFormValid}
          />
          <Button
            value="Log In"
            className="logIn"
            // disabled={!state.isFormValid}
          />
      </div>
    </div>
  );
}


export default SingupForm;
